import React from "react";

function TaskList({ selectCategory, category }) {
  return (
    <div>
      {selectCategory !== "All"
        ? selectCategory.map((task, index) => <p key={index}> {task}</p>)
        : selectCategory.map((eachCat, index1) => {
            return eachCat.map((task, index2) => {
              return <p key={index1 + "-" + index2}>{task}</p>;
            });
          })}
    </div>
  );
}

export default TaskList;
